import React,{Component} from "react";
import { Link } from 'react-router-dom';
import '../App.css';

class Home extends Component{

  render () {
    return (
      <div className="header">
        <Link to="/signIn" className="SignIn">Iniciar Sesion</Link>
      </div>
    );
  }
}

export default Home;
